import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';
import App from './App';
import reportWebVitals from './reportWebVitals';
import '../src/styles/partials';
import '../src/styles/partials/_breakpoints.scss';
import '../src/styles/partials/_colors.scss';
import '../src/styles/partials/_fonts.scss';
import '../src/styles/partials/_global.scss';
import '../src/styles/partials/_mixins.scss';

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
    <App />
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
